import LoginForm from './components/LoginForm';
import RegistrationForm from './components/RegistrationForm';
// Importuj inne komponenty, które będą wykorzystywane

const routes = [
 {
    path: 'http://localhost:3000/routes/register',
    exact: true,
    component: component.RegistrationForm
  },

  {
    path: 'http://localhost:3000/routes/login',
    exact: true,
    component: component.LoginForm,
  },
  // Dodaj inne trasy według potrzeb
];

export default routes;
